import React, { Component } from 'react';

export default class App extends Component {
  constructor() {
    super();
    this.state = {
      count: 0,
    };
  }

  increment = (value) => {
    this.setState((prevState) => ({
      count: prevState.count + value,
    }));
  };

  render() {
    return (
      <div>
        {this.state.count}
        <button onClick={this.increment(5)}>+</button>
      </div>
    );
  }
}
